        public void PopulatePlanSelectList(SubscriberChargeViewModel viewModel)
        {
			viewModel.PlanSelectList = _context.SubscriberTypeGetAllStandard()
				.ToList()
				.Select(x => new SelectListItem {
					Text = x.Name,
					Value = x.SubscriberTypeID.ToString()
				})
				.ToList();
        }

        public void PopulateSubscriberChargeInfoViewModel(SubscriberChargeInfoViewModel viewModel, Subscriber subscriber)
        {
			var stripeCustomerService = new Stripe.CustomerService();
			var stripeCustomer = stripeCustomerService.Get(subscriber.StripeCustomerID, new Stripe.CustomerGetOptions {
				Expand = new List<string>() { "subscriptions", "sources" }
			});

			if (stripeCustomer != null)
            {
				if (stripeCustomer.Sources.Data.Count > 0)
                {
					var card = (stripeCustomer.Sources.Data[0] as Stripe.Card);
					if (card != null)
						viewModel.CardLastFour = string.Format("{0} ************{1}, {2}/{3}", card.Brand, card.Last4, card.ExpMonth, card.ExpYear);
				}
				if (stripeCustomer.Subscriptions.Data.Count > 0)
                {
					viewModel.HasSubscription = true;

					var subscription = stripeCustomer.Subscriptions.Data[0];
					viewModel.StripeSubscriptionId = subscription.Id;
					if (subscription.Items.Count() > 0)
                    {
						var subscriptionItem = subscription.Items.FirstOrDefault();
						viewModel.PlanText = subscriptionItem.Price.Nickname;
						viewModel.StripePlanId = subscriptionItem.Price.Id;
                    }

					viewModel.SubscriptionStatus = subscription.Status;
					viewModel.SubscriptionPeriod = string.Format("{0:MMM d, yyyy} - {1:MMM d, yyyy}", subscription.CurrentPeriodStart, subscription.CurrentPeriodEnd);

					string subscriptionPendingAction;
					if (subscription.CancelAtPeriodEnd)
                    {
						bool isCancellation = subscriber.PendingSubscriberTypeID == (int)SubscriberTypeID.NoCreditCard;
						subscriptionPendingAction = isCancellation ? "cancel" : "change";
                    } else
                    {
						subscriptionPendingAction = "renew";
                    }
					viewModel.ListSubscriptionPendingActionText = string.Format("Subscription will {0} on {1}",
							subscriptionPendingAction,
							string.Format("{0:MMM d, yyyy}", subscription.CurrentPeriodEnd));

				}
            }

			viewModel.Invoices = _context.SubscriberInvoiceGetBySubscriberID(subscriber.SubscriberID).ToList();
        }

        public AddressViewModel GetAddressPageViewModel(string subscriberID)
        {
			AddressViewModel viewModel = new AddressViewModel();
			
			viewModel.CountryList = Constants.Countries.Select(x => new SelectListItem
			{
				Value = x,
				Text = x
			}).ToList();

			var addressInfo = _context.SubscriberGetStatsByID(subscriberID.ToNullableInt()).FirstOrDefault();
			if (addressInfo != null)
            {
				viewModel.Address1 = addressInfo.Address1;
				viewModel.Address2 = addressInfo.Address2;
				viewModel.Address3 = addressInfo.Address3;
				viewModel.City = addressInfo.City;
				viewModel.State = addressInfo.State;
				viewModel.Zipcode = addressInfo.Zipcode;
				viewModel.Country = addressInfo.Country;
				viewModel.Phone = addressInfo.Phone;

				
				if (!viewModel.CountryList.Any(x => x.Value == viewModel.Country))
                {
					viewModel.CountryList.Insert(1, new SelectListItem { Value = viewModel.Country, Text = viewModel.Country });
                }

			}
			return viewModel;
		}

        public bool UpdateSubscriberAddress(string subscriberId, AddressViewModel viewModel)
        {
			return _context.SubscriberUpdate4(subscriberId.ToNullableInt(),
				viewModel.Address1,
				viewModel.Address2,
				viewModel.Address3,
				viewModel.City,
				viewModel.State,
				viewModel.Zipcode,
				viewModel.Country,
				viewModel.Phone) > 0;
		}

        public SubscriberVendorsPageViewModel GetSubscriberVendorsPageViewModel(string subscriberID, bool blocked)
        {
			SubscriberVendorsPageViewModel viewModel = new SubscriberVendorsPageViewModel();
			if (blocked)
            {
				viewModel.VendorsPageMode = VendorsPageMode.Blocked;
				viewModel.Vendors = _context.VendorSubscriberBlockedGetBySubscriberID(subscriberID.ToNullableInt())
					.Select(x => new VendorInfo { 
						VendorID = x.VendorID,
						VendorName = x.VendorName,
						Country = x.Country,
						DateCreated = x.DateCreated
					})
					.ToList();
			} else
            {
				viewModel.VendorsPageMode = VendorsPageMode.Preferred;
				viewModel.Vendors = _context.VendorSubscriberPreferredGetBySubscriberID(subscriberID.ToNullableInt())
					.Select(x => new VendorInfo
					{
						VendorID = x.VendorID,
						VendorName = x.VendorName,
						Country = x.Country,
						DateCreated = x.DateCreated
					})
					.ToList();
			}
			return viewModel;
        }

        public bool UndoPreferBlock(VendorsPageMode mode, int vendorId, string subscriberID)
        {
            if (mode == VendorsPageMode.Blocked)
            {
				return _context.VendorSubscriberBlockedDelete(vendorId, subscriberID.ToNullableInt()) > 0;
			} else
            {
				return _context.VendorSubscriberPreferredDelete(vendorId, subscriberID.ToNullableInt()) > 0;
			}
        }

        public List<VendorQuoteGetByUserID_Result> GetQuotePageViewModel(string userID)
        {
			return _context.VendorQuoteGetByUserID(userID.ToNullableInt()).ToList();
